type addressTestCase struct {
	addr          Trytes
	validAddr     bool
	checksum      Trytes
	validChecksum bool
}

var addressTCs = []addressTestCase{
	addressTestCase{
		addr:          "RGVOWCDJAGSO9TNLBBPUVYE9KHBOAZNVFRVKVYYCHRKQRKRNKGGWBF9WCRJVROKLVKWZUMBABVJGAALWU",
		validAddr:     true,
		checksum:      "NPJ9QIHFW",
		validChecksum: true,
	},
	addressTestCase{
		addr:          "",
		validAddr:     false,
		checksum:      "",
		validChecksum: true,
	},
	addressTestCase{
		addr:          "999999999999999999999999999999999999999999999999999999999999999999999999999999999999999999",
		validAddr:     true,
		checksum:      "A9BEONKZW",
		validChecksum: true,
	},
	addressTestCase{
		addr:          "RGVOWCDJAGSO9TNLBBPUVYE9KHBOAZNVFRVKVYYCHRKQRKRNKGGWBF9WCRJVROKLVKWZUMBABVJGAALWU",
		validAddr:     true,
		checksum:      "A9BEONKZW",
		validChecksum: false,
	},
}

func TestNewAddressFromTrytes(t *testing.T) {
	for _, tc := range addressTCs {
		adr, err := tc.addr.ToAddress()
		if (err != nil) == tc.validAddr {
			t.Fatalf("NewAddressFromTrytes(%q) expected (err != nil) to be %#v\nerr: %#v", tc.addr, tc.validAddr, err)
		}
		if (err == nil && adr.Checksum() != tc.checksum) == tc.validChecksum {
			t.Fatalf("NewAddressFromTrytes(%q) checksum mismatch\nwant: %s\nhave: %s", tc.addr, tc.checksum, adr.Checksum())
		}
		if !tc.validAddr || !tc.validChecksum {
			continue
		}
		wcs := adr.WithChecksum()
		if wcs != Trytes(adr)+adr.Checksum() {
			t.Error("WithChecksum is incorrect")
		}
		adr2, err := ToAddress(string(tc.addr))
		if err != nil {
			t.Error(err)
		}
		if adr != adr2 {
			t.Error("ToAddress is incorrect")
		}
	}
}

func TestAddress(t *testing.T) {
	var seed Trytes = "WQNZOHUT99PWKEBFSKQSYNC9XHT9GEBMOSJAQDQAXPEZPJNDIUB9TSNWVMHKWICW9WVZXSMDFGISOD9FZ"
	var adr0 Trytes = "AYYNHWWNZQOFYXNQSLVULU9ARZCSXNWWAFYEWEL9LIXYDFS9KDSRZF9ZID9AQWSLAEUAJSTQKGPGXNWCD"
	var adr1 Trytes = "9CTFIAYOFLOKXVNDFKNERQQEFR9FCIXQQHNRDKHIVVGFZQKTBWPCOIHCCQIU9ASJQECGPHDBAREDXIRCX"
	adr, err := NewAddress(seed, 0, 2)
	if err != nil {
		t.Fatal(err)
	}
	adr00, err := adr0.ToAddress()
	if err != nil {
		t.Fatal(err)
	}
	if adr00 != adr {
		t.Error("address unmatch", adr)
	}
	adr, err = NewAddress(seed, 1, 2)
	if err != nil {
		t.Fatal(err)
	}
	adr11, err := adr1.ToAddress()
	if err != nil {
		t.Fatal(err)
	}
	if adr11 != adr {
		t.Error("address unmatch", adr)
	}
	if err := adr.IsValid(); err != nil {
		t.Error("IsValid is incorrect")
	}
}

func TestSeed(t *testing.T) {
	for i := 0; i < 10000; i++ {
		s1 := NewSeed()
		if err := s1.IsValid(); err != nil {
			t.Error("NewSeed is not valid")
		}
		s2 := NewSeed()
		if err := s2.IsValid(); err != nil {
			t.Error("NewSeed is not valid")
		}
		if s1 == s2 {
			t.Error("NewSeed is incorrect")
		}
	}
}

func TestSign(t *testing.T) {
	var seed Trytes = "WQNZOHUT99PWKEBFSKQSYNC9XHT9GEBMOSJAQDQAXPEZPJNDIUB9TSNWVMHKWICW9WVZXSMDFGISOD9FZ"
	var bundleHash Trytes = "CDMEKHAJFKDZPPUSQWALZNFSDDRPQDEFSPUSHLSUDWWVLXYZJIG9XHVRFJZHFSMSXS9ZPQHLF9WTYBWDW"
	var csign0 Trytes = ""
	var csign1 Trytes = ""
	key, err := NewKey(seed, 0, 2)
	if err != nil {
		t.Fatalf("NewKey(): %#v", err)
	}
	norm := bundleHash.Normalize()
	sign0 := Sign(norm[:27], key[:SignatureSize/3])
	if sign0 != csign0 {
		t.Error("sig is incorrect.")
	}
	sign1 := Sign(norm[27:54], key[SignatureSize/3:SignatureSize*2/3])
	if sign1 != csign1 {
		t.Error("sig is incorrect.")
	}

	adr, err := NewAddress(seed, 0, 2)
	if err != nil {
		t.Fatal(err)
	}
	if !IsValidSig(adr, []Trytes{sign0, sign1}, bundleHash) {
		t.Error("cannot validate signature.")
	}

}
